import { css } from "styled-components";

export const InterNormalWhite16px = css`
  color: var(--white);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-l2);
  font-weight: 400;
  font-style: normal;
`;

export const InterNormalWhite12px = css`
  color: var(--white-2);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-s2);
  font-weight: 400;
  font-style: normal;
`;

export const InterMediumWhite16px = css`
  color: var(--white);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-l2);
  font-weight: 500;
  font-style: normal;
`;

export const InterMediumWhite20px = css`
  color: var(--white);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-xxl2);
  font-weight: 500;
  font-style: normal;
`;

export const InterNormalWhite16px2 = css`
  color: var(--white-3);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-l2);
  font-weight: 400;
  font-style: normal;
`;

export const InterBoldWhite120px = css`
  font-family: var(--font-family-inter);
  font-size: var(--font-size-xxxl);
  font-weight: 700;
  font-style: normal;
`;

export const InterBoldWhite84px = css`
  color: var(--white);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-xxl3);
  font-weight: 700;
  font-style: normal;
`;

export const InterBoldWhite20px = css`
  color: var(--white);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-xxl2);
  font-weight: 700;
  font-style: normal;
`;

export const InterNormalWhite14px = css`
  color: var(--white-5);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-m2);
  font-weight: 400;
  font-style: normal;
`;

export const InterSemiBoldWhite16px = css`
  color: var(--white);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-l2);
  font-weight: 600;
  font-style: normal;
`;
